import { Container, Grid, Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";

const EverythingYouNeed = () => {
  return (
    <div>
      <Container>
        <Typography
          color="#00B0EF"
          fontSize={36}
          fontWeight="700"
          width={"60%"}
        >
          Everything you need to know about COVID-19 Vaccination Across the
          state
        </Typography>
        <Box>
          <Grid container>
            <Grid item xs={12} sm={6} md={4}>
              <Box
                display="flex"
                flexDirection={"column"}
                justifyContent="space-between"
                alignItems={"stretch"}
              >
                <Typography
                  fontSize={21}
                  fontWeight="700"
                  color="black"
                  textAlign={"justify"}
                >
                  Do you have questions or concerns about the COVID-19 vaccine?
                </Typography>
                <Typography textAlign="justify" fontSize={18} fontWeight="400">
                  Please Contact NPHCDA's COVID-19 call center on 09023929940
                </Typography>
              </Box>
            </Grid>
          </Grid>
        </Box>
      </Container>
    </div>
  );
};

export default EverythingYouNeed;
